داخل ساحة Vault Plaza الافتراضية، سيجد أعضاء المجتمع مساحة عرض مستوحاة من المحادثات التي بدأت داخل منصة Vault، وهو متجر المفاهيم التجريبي الخاص بالدار، ويعد نظيراً افتراضياً على Roblox، ويعرض أحدث منتجات Gucci وعمليات التعاون الخاصة بالدار.
